import React, {Component} from 'react';
import { Grid, Cell } from 'react-mdl';

class Landing extends Component {
  render() {
  	return (
  		<div style={{width: '100%', margin: 'auto'}}>
  			<Grid className="landing-grid">
  				<Cell col={12}>
  					<img
  						src="https://www.google.com/url?sa=i&rct=j&q=&esrc=s&source=images&cd=&ved=2ahUKEwig3KqG253jAhVJeMAKHXTkCFsQjRx6BAgBEAU&url=https%3A%2F%2Fwww.iconfinder.com%2Ficons%2F628289%2Favatar_business_costume_male_man_office_work_icon&psig=AOvVaw2hULwd3SRnDQZ4gJ9KNo0c&ust=1562413776344295"
  						alt="avatar"
  						className="avatar-img"
  					/>
  				</Cell>

  			</Grid>

  		</div>
  		
  		)
  }
}
export default Landing;
